import React, { useState } from 'react';
import Sidebar from '../components/CustSidebar';
import './ServiceHistory.css';

interface ServiceItem {
  id: number;
  name: string;
  details: string;
  price: number;
  technicianName: string;
}

interface ServiceRecord {
  id: number;
  make: string;
  model: string;
  year: number;
  serviceDate: string;
  completionDate: string | null;
  status: 'completed' | 'in-progress' | 'scheduled';
  services: ServiceItem[];
  totalCost: number;
  warrantyEnd: string | null;
  invoiceNumber: string;
  technicianName: string;
}

const ServiceHistory: React.FC = () => {
  const [vehicleFilter, setVehicleFilter] = useState<string>('all');
  
  const serviceHistory: ServiceRecord[] = [/* keep your existing data */];

  const filteredHistory = serviceHistory.filter(record => 
    vehicleFilter === 'all' || `${record.make} ${record.model}` === vehicleFilter
  );

  const vehicleOptions = Array.from(new Set(serviceHistory.map(r => `${r.make} ${r.model}`)));

  const formatDate = (dateString: string) => 
    new Date(dateString).toLocaleDateString(undefined, { year: 'numeric', month: 'short', day: 'numeric' });

  const formatCurrency = (amount: number) => 
    new Intl.NumberFormat('en-US', { style: 'currency', currency: 'USD' }).format(amount);

  return (
    <div className="app-container">
      <Sidebar />
      <div className="main-content">
        <h1>Service History</h1>
        <p>View your vehicle maintenance and repair history</p>
        
        <select className="filter-dropdown" value={vehicleFilter} onChange={e => setVehicleFilter(e.target.value)}>
          <option value="all">All Vehicles</option>
          {vehicleOptions.map(vehicle => <option key={vehicle} value={vehicle}>{vehicle}</option>)}
        </select>

        {filteredHistory.length === 0 ? (
          <div className="empty-history">
            <h3>No Service History Found</h3>
            <button className="add-vehicle-btn" onClick={() => console.log('Schedule service')}>
              Schedule a Service
            </button>
          </div>
        ) : (
          <div className="service-history-grid">
            {filteredHistory.map(record => (
              <div key={record.id} className="history-card">
                <div className="vehicle-header">
                  <div>{record.make} {record.model}</div>
                  <div className={`service-status ${record.status}`}>
                    {record.status.replace('-', ' ').toUpperCase()}
                  </div>
                </div>
                
                <div className="history-content">
                  <div className="service-date-info">
                    {record.status === 'completed' 
                      ? `Completed: ${formatDate(record.completionDate!)}` 
                      : record.status === 'scheduled' 
                        ? `Scheduled: ${formatDate(record.serviceDate)}`
                        : `Started: ${formatDate(record.serviceDate)}`}
                  </div>
                  
                  <ul className="completed-services">
                    {record.services.map(service => (
                      <li key={service.id} className="service-item">
                        <div className="service-name">
                          {service.name} - {formatCurrency(service.price)}
                        </div>
                        <div className="service-details">{service.details}</div>
                        {service.technicianName !== 'Not assigned' && 
                          <div className="technician-info">Technician: {service.technicianName}</div>}
                      </li>
                    ))}
                  </ul>
                  
                  <div className="service-total">Total: {formatCurrency(record.totalCost)}</div>
                  
                  <div className="history-actions">
                    {record.status === 'completed' && (
                      <button className="action-button" onClick={() => console.log('View invoice')}>
                        View Invoice
                      </button>
                    )}
                    <button className="action-button" onClick={() => console.log('Schedule service')}>
                      {record.status === 'completed' ? 'Schedule Similar' : 'Modify Appointment'}
                    </button>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default ServiceHistory;
